import React, { useState } from 'react';
import Esp1 from '../../components/info/Esp1';
import Graph from '../../components/graphe/Graph';
import "./home.css";
import { Form } from 'react-bootstrap';


function Home({accessToken, search, setSearch}) {
    
    console.log("recherche :",  search)

   

    return (
        <div>       
        <div className="home">
        <Esp1 accessToken={accessToken}/>
            <Graph accessToken={accessToken} search={search} setSearch={setSearch}/>            
        </div>
        </div>
    )
}

export default Home
